import React from "react";

const meal_details = [
    {name:"biryani",price:"500",discount:"20%"},
    {name:"paratha",price:"500",discount:"20%"},
    {name:"chowmein",price:"500",discount:"20%"},
    {name:"oats",price:"500",discount:"20%"},
    {name:"upma",price:"20",discount:"20%"},
    {name:"kanji",price:"20",discount:"20%"},
    {name:"halwa",price:"50",discount:"20%"}
] 


const DisplayMeals = () => {
    const MealsList = meal_details.map((each) => {
        console.log(each.name);
        return(
            <div>
                <h1>{each.name}</h1>
            </div>
        );
    });

    return(
        <div>
            {MealsList}
        </div>
    );
}

export default DisplayMeals;
